import React from 'react';
import './App.css';

function App(){
  const hello = () =>{
    console.log("Ola Mundo");
  }
  return (
   <div className="App">
    <h3>Oi Mundo!</h3>
    <button onClick={hello}>Hello</button>
   </div>
  )
}

export default App;
